create table company
(
    company_id       bigint auto_increment
        primary key,
    company_industry varchar(255)                                null,
    company_location varchar(255)                                null,
    company_name     varchar(255)                                not null,
    company_size     enum ('대기업', '중견기업', '중소기업', '공기업', '정보없음') null,
    company_visible  bit         default b'1'                    null,
    updated_at       datetime(6) default CURRENT_TIMESTAMP(6)    null,
    search_keyword   varchar(255)                                null,
    dart             bit                                         null
);

